import './index.css';
import DataSummary from './components/DataSummary';
import {useState} from 'react';


function App() {
  const showDataSummary=true;
  const [role,setRole] = useState('dev');
  return (
    <div className="App">      
      {showDataSummary ? (
        <div className="App">
          <DataSummary name="Day"/>
          <DataSummary name="Week"/>
          <DataSummary name="Month"/>
          <DataSummary name="All Time"/>
        </div>
    ) : (
      <p>You cannot see the DataSummaries</p>
    ) }
    </div>
  );
}

export default App;
